import styled from 'styled-components'
import { Parallax, Background } from 'react-parallax';


const Head = styled.div`
    display: flex;
    flex-direction: column;
    text-align: left;
`

const About = () => (
    <div>
<div class="parallax"></div>
    <Head><h1> Dawei Liu </h1></Head>
    <div class="parallax"> </div>


    </div>


)

export default About
